import React from "react";
import "./App.css";
import "./Project.css";
import DoubleRow from "./components/DoubleRow";
import SingleRow from "./components/SingleRow";


function Projects() {

  return (
    <div className="About" >

          <div className='PageWrapper' style={{ paddingTop:160, paddingLeft:40, paddingRight:40 , backgroundColor:'#f0f0f0' , 
        position:'relative',zIndex:7}}>

            <div className="BodyRight" style={{paddingBottom:40}}>

            <p>Dive into our<span className="FirstSpan">Latest</span> <span className="SecondSpan">Design Projects </span></p>

            </div>

          </div>

          <div>
          <DoubleRow 
                  name1='Qui Achieve' year1='2022' img1={Project1}
                  name2='Gifty' year2='2021' img2={Project2} 
                  />

                  <SingleRow 
                  name='Project' year='2021' img={Project3}/>

                  <DoubleRow 
                  name1='Qui Achieve' year1='2022' img1={Project4}
                  name2='Gifty' year2='2021' img2={Project5} 
                  />


          </div>




    </div>
  );
}

export default Projects;
